import './App.css';
import React, {useState, useEffect } from "react";
import axios from './axios';



function Adminpanel() {
  const [data, getData] = useState([])
  const URL = 'http://localhost:3000/dogs';

  useEffect(() => {
      fetchData()
  }, [])


  const fetchData = () => {
      fetch(URL)
          .then((res) =>
              res.json())

          .then((response) => {
              console.log(response);
              getData(response);
          })

  }

  return (
      <>

          <tbody>
              <tr>
                  <th>Dog ID</th>
                  <th>Name</th>
                  <th>Breed</th>
                  <th>Location</th>
                  <th>img</th>
              </tr>
              {data.map((item, i) => (
                  <tr key={i}>
                      <td>{item._id}</td>
                      <td>{item.name}</td>
                      <td>{item.breed}</td>
                      <td>{item.location}</td>
                      <td>{item.img}</td>

                  </tr>
              ))}
          </tbody>

          <div className='POSTadog'>



          <form onSubmit={handleSubmit}>
                        <label htmlFor="username">
                            Username:

                        </label>
                        <input
                            type="text"
                            id="username"
                            ref={userRef}
                            autoComplete="off"
                            onChange={(e) => setUser(e.target.value)}
                            value={user}
                            required
                            aria-describedby="uidnote"
                        />


                        <label htmlFor="password">
                            Password:

                        </label>
                        <input
                            type="password"
                            id="password"
                            onChange={(e) => setPwd(e.target.value)}
                            value={pwd}
                            required

                            aria-describedby="pwdnote"
                        />

                  <label htmlFor="username">
                            Staff code:

                        </label>
                        <input
                            type="text"
                            id="staffcode"
                            autoComplete="off"
                            onChange={(e) => setStaff(e.target.value)}
                            value={staffcode}
                            required
                            aria-describedby="uidnote"
                        />






                        <button>Sign Up</button>
                    </form>

          </div>

      </>
  );
}




export default Adminpanel;
